#define _GNU_SOURCE

#include <stdlib.h>
#include <stdio.h>
#include <unistd.h>
#include <fcntl.h>
#include <sys/wait.h>

#define pexit(msg) { perror(msg); return 1; }

int main(int argc, char *argv[])
{
	int in, out, pipefd[2], pid, r;
	ssize_t copied;
	size_t size = 0x7FFFFFFFBFA00000;

	// This fixes the splice()
	// size--;

	in = open(argv[1], O_RDONLY, O_CLOEXEC);
	if (in < 0)
		pexit("open");

	out = open(argv[2], O_WRONLY | O_CREAT, 0644);
	if (out < 0)
		pexit("open");

	r = pipe(pipefd);
	if (r < 0)
		pexit("pipe");

	pid = fork();
	if (pid < 0)
		pexit("fork()");

	if (!pid) {
		r = dup2(pipefd[0], 0);
		if (r < 0)
			pexit("dup");
		close(pipefd[0]);

		r = dup2(out, 1);
		if (r < 0)
			pexit("dup");
		close(out);

		execvp("cat", (char*[]){"cat", NULL});
		pexit("exec");
	}

	close(pipefd[0]);
	close(out);

	do {
		copied = splice(in, NULL, pipefd[1], NULL, size, 0);
		if (copied < 0)
			pexit("splice");
	} while (copied);

	close(pipefd[1]);
	wait(NULL);

	return 0;
}

